import React from "react";
import DoctorMenu from "../components/layout/DoctorMenu";
import "../styles/hi.css";
import { ByeWind } from "./ByeWind";
import { Content } from "./Content";
import { IconSet } from "./IconSet";
import { IconText } from "./IconText";
import { Line } from "./Line";
import { SelectTrueStateDefault } from "./SelectTrueStateDefault";
import { Text } from "./Text";
import { WeightRegular } from "./WeightRegular";

const DoctorProfile = () => {
  return (
    <DoctorMenu>
      <div className="frame">
        <Content
          className="content-instance"
          hover={false}
          iconTextIconSetIcon={<ByeWind className="bye-wind-instance" />}
          iconTextIconSetSize="forty-eight"
          iconTextTextDivClassName="design-component-instance-node-2"
          iconTextTextNumber="two"
          iconTextTextText="Alex@ twitter.com"
          iconTextTypeIconTextClassName="content-2"
          type="single"
        />
        <Content
          className="content-3"
          hover={false}
          override={
            <Text
              className="text-2"
              direction="vertical"
              number="one"
              text="Name"
            />
          }
          override1={
            <IconText
              className="design-component-instance-node-3"
              override={
                <WeightRegular className="arrow-line-right" opacity="0.2" />
              }
              textDivClassNameOverride="icon-text-2"
              textText1="Alex"
              type="text-icon"
            />
          }
          type="left-right"
        />
        <Line
          className="line-instance"
          direction="horizontal"
          line="image.svg"
          lineClassName="line-2"
          number="one"
        />
        <Text
          className="text-3"
          direction="vertical"
          divClassNameOverride="design-component-instance-node-2"
          number="one"
          text="Account security"
        />
        <Content
          className="content-3"
          hover={false}
          override={
            <Text
              className="text-2"
              direction="vertical"
              number="one"
              text="Email"
            />
          }
          override1={
            <IconText
              className="design-component-instance-node-3"
              textDivClassNameOverride="icon-text-2"
              textText1="alex@twitter.com"
              type="text-icon"
            />
          }
          type="left-right"
        />
        <div className="content-4">
          <Text
            className="text-5"
            direction="vertical"
            divClassName1="text-4"
            number="two"
            text="Change password to login to your account."
          />
          <IconSet
            BG={false}
            badge={false}
            className="icon-set-3"
            icon={<WeightRegular className="arrow-line-right" opacity="0.2" />}
            size="twenty"
          />
        </div>
        <Content
          className="content-5"
          hover={false}
          override={
            <Text
              className="text-5"
              direction="vertical"
              divClassName1="text-4"
              number="two"
              text="Add an additional layer of security to your account during login."
            />
          }
          override1={
            <IconSet
              BG={false}
              badge={false}
              className="design-component-instance-node-3"
              icon={<SelectTrueStateDefault className="toggle" />}
              size="thirty-two"
            />
          }
          type="left-right"
        />
        <Line
          className="line-instance"
          direction="horizontal"
          line="line-2.svg"
          lineClassName="line-2"
          number="one"
        />
        <Text
          className="text-3"
          direction="vertical"
          divClassNameOverride="design-component-instance-node-2"
          number="one"
          text="Support"
        />
        <Content
          className="content-5"
          hover={false}
          override={
            <Text
              className="text-5"
              direction="vertical"
              divClassName="text-6"
              divClassName1="text-4"
              number="two"
              text={
                <>
                  Grant Ares Elite App support temporary access to your account
                  so we can troubleshoot problems or recover content on your
                  behalf.
                  <br />
                  You can revoke access at any time.
                </>
              }
            />
          }
          override1={
            <IconSet
              BG={false}
              badge={false}
              className="design-component-instance-node-3"
              icon={<SelectTrueStateDefault className="toggle" />}
              size="thirty-two"
            />
          }
          type="left-right"
        />
        <Content
          className="content-5"
          hover={false}
          override={
            <Text
              className="text-5"
              direction="vertical"
              divClassName="text-6"
              divClassName1="text-4"
              number="two"
              text="View the privacy policy of Ares Elite."
            />
          }
          override1={
            <IconSet
              BG={false}
              badge={false}
              className="design-component-instance-node-3"
              icon={
                <WeightRegular className="arrow-line-right" opacity="0.2" />
              }
              size="twenty"
            />
          }
          type="left-right"
        />
        <Content
          className="content-5"
          hover={false}
          override={
            <Text
              className="text-5"
              direction="vertical"
              divClassName="text-6"
              divClassName1="text-4"
              number="two"
              text="View the terms of use of Ares Elite,"
            />
          }
          override1={
            <IconSet
              BG={false}
              badge={false}
              className="design-component-instance-node-3"
              icon={
                <WeightRegular className="arrow-line-right" opacity="0.2" />
              }
              size="twenty"
            />
          }
          type="left-right"
        />
        <Content
          className="content-5"
          hover={false}
          override={
            <Text
              className="text-5"
              direction="vertical"
              divClassName="text-7"
              divClassName1="text-4"
              number="two"
              text="Log out of all other active sessions on other devices."
            />
          }
          override1={
            <IconSet
              BG={false}
              badge={false}
              className="design-component-instance-node-3"
              icon={
                <WeightRegular className="arrow-line-right" opacity="0.2" />
              }
              size="twenty"
            />
          }
          type="left-right"
        />
      </div>
    </DoctorMenu>
  );
};

export default DoctorProfile;
